=You are a lead scoring AI. Score this lead from 1-10 based on job title seniority, company size, location, and data confidence.

Lead Data:
- Name: {{ $json.name }}
- Job Title: {{ $json.current_title }}
- Company: {{ $json.current_employer }}
- Email: {{ $json.emails?.[0]?.email ?? 'N/A' }}
- Phone: {{ $json.phones?.[0]?.number ?? 'N/A' }}
- Confidence: {{ $json.confidence }}
- Location:{{ $json.location || 'unknown' }} 
-current Employer Id:{{ $json.current_employer_id }}
- Company Size: {{ $json.current_employer_size ?? 'Unknown' }}

Return ONLY valid JSON with this exact structure (no markdown, no extra text):
{
  "score": <number 1-10>,
  "priority": "<High|Medium|Low>",
  "reason": "<brief explanation>"
}

parameters.jsCode:
// Grade ‚Üí confidence mapping
const gradeToConfidence = {
  A: 0.9,
  B: 0.7,
  C: 0.5,
  D: 0.3
};

return items.map(item => {
  const data = item.json;

  const emails = data.emails || [];

  // Prefer professional email first, then personal
  const selectedEmail =
    emails.find(e => e.type === 'professional') ||
    emails.find(e => e.type === 'personal') ||
    null;

  const grade = selectedEmail?.grade || 'D';
  const confidence = gradeToConfidence[grade] ?? 0.3;

  return {
    json: {
      ...data,

      // Normalized fields
      selected_email: selectedEmail?.email || null,
      email_type: selectedEmail?.type || null,
      email_grade: grade,
      confidence: confidence
    }
  };
});

